import axios from "axios";
import { ref } from "vue";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = async () => {
    return fetch(apiUrl+"/calendar/week")
      .then(response => response.json())
      .then(data => (apiData.value = data));
  }

  return {
    apiData
  }
}
